import React from "react";
import { Link } from "react-router-dom";

const AllQuotes = () => {
  return <div>
    <h1>All Quotes</h1>
    <ul>
      <li><Link to='/Apple'>Apple</Link></li>
      <li><Link to='/Doctor'>Doctor</Link></li>
      <li><Link to='/Something'>Something</Link></li>
    </ul>
  </div>;
};

export default AllQuotes;
